import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="container my-3" id="contactSection">
      <div className="row justify-content-center">
        <div className="col Contact text-center py-3">
            <h3 className="ContactUs">Contact Us!!!</h3>
          <p>My Website Pvt.Ltd</p>
          <p>Kanyakumari, Tamil Nadu, India.</p>
          
        </div>
      </div>
    </div>
  );
}

export default Contact;
